(414, 533, 'reports', '1', '{\"id\":\"1\",\"created_by\":\"1\",\"created_on\":\"2020-02-27 04:53:28\",\"query\":\"SELECT \\ndate_format(time_of_transaction,\'%d-%m-%Y %h:%i:%s\') as Tijdstip,\\namount as Bedrag,\\nif(top_off, \'Ja\', \'Nee\') as Teruggave,\\ntransactions.description as Omschrijving,\\nCONCAT(users.first_name, \' \',users.last_name) as Gebruiker,\\ncards.code as Kaart,\\nterminals.code as Terminal_Omschrijving\\nFROM `transactions`, `cardleasings`, `users`, `cards`, `terminals`\\nWHERE transactions.cardleasing = cardleasings.id AND cardleasings.user = users.id AND cardleasings.card = cards.id AND `terminals`.`id` = `transactions`.`terminal`\\nAND `time_of_transaction` BETWEEN \'$#Van$#\' and \'$#Tot$#\' \\nAND `users`.`id` = $#User$#\",\"title\":\"Transacties per User\",\"parameterobject\":[{\"name\":\"Van\",\"type\":\"DATE\",\"value\":\"\",\"isCollectionItem\":false},{\"name\":\"Tot\",\"type\":\"DATE\",\"value\":\"\",\"isCollectionItem\":false},{\"name\":\"User\",\"type\":\"STRING\",\"value\":\"\",\"isCollectionItem\":true,\"collectionName\":\"users\",\"showInputAs\":\"SEARCHBOX\",\"showProps\":[\"first_name\",\"last_name\"]}],\"key\":\"TransactiesPerUser\",\"parameterchars\":\"$#\",\"fieldsobject\":null,\"landscape\":false,\"pivot_table\":false,\"pivot_info\":null}', '{\"landscape\":false,\"pivot_table\":false,\"query\":\"SELECT \\ndate_format(time_of_transaction,\'%d-%m-%Y %h:%i:%s\') as Tijdstip,\\namount as Bedrag,\\nif(top_off, \'Ja\', \'Nee\') as Teruggave,\\ntransactions.description as Omschrijving,\\nCONCAT(users.first_name, \' \',users.last_name) as Gebruiker,\\ncards.code as Kaart,\\nterminals.code as Terminal_Omschrijving\\nFROM `transactions`, `cardleasings`, `users`, `cards`, `terminals`\\nWHERE transactions.cardleasing = cardleasings.id AND cardleasings.user = users.id AND cardleasings.card = cards.id AND `terminals`.`id` = `transactions`.`terminal`\\nAND `time_of_transaction` BETWEEN \'$#Van$#\' and \'$#Tot$#\' \\nAND `users`.`id` = $