INSERT INTO `reports` (`id`, `created_by`, `created_on`, `query`, `title`, `parameterobject`, `key`, `parameterchars`, `fieldsobject`, `landscape`, `pivot_table`, `pivot_info`) VALUES
(1, 1, '2020-02-27 04:53:28', 'SELECT \ndate_format(time_of_transaction,\'%d-%m-%Y %h:%i:%s\') as Tijdstip,\namount as Bedrag,\nif(top_off, \'Ja\', \'Nee\') as Teruggave,\ntransactions.description as Omschrijving,\nCONCAT(users.first_name, \' \',users.last_name) as Gebruiker,\ncards.code as Kaart,\nterminals.code as Terminal_Omschrijving\nFROM `transactions`, `cardleasings`, `users`, `cards`, `terminals`\nWHERE transactions.cardleasing = cardleasings.id AND cardleasings.user = users.id AND cardleasings.card = cards.id AND `terminals`.`id` = `transactions`.`terminal`\nAND `time_of_transaction` BETWEEN \'$#Van$#\' and \'$#Tot$#\' \nAND `users`.`id` = $#User$#', 'Transacties per User', '[{\"name\":\"Van\",\"type\":\"DATE\",\"value\":\"\",\"isCollectionItem\":false},{\"name\":\"Tot\",\"type\":\"DATE\",\"value\":\"\",\"isCollectionItem\":false},{\"name\":\"User\",\"type\":\"STRING\",\"value\":\"\",\"isCollectionItem\":true,\"collectionName\":\"users\",\"showInputAs\":\"SEARCHBOX\",\"showProps\":[\"first_name\",\"last_name\"]}]', 'TransactiesPerUser', '$#', NULL, 0, 0, NULL);
